App = Em.Application.create({
    rootElement: $(".view-container")
}), App.Router.map(function() {
    this.route("read", {
        path: "/read"
    }), this.route("insert", {
        path: "/insert"
    });
}), App.IndexRoute = Ember.Route.extend({
    setupController: function(a) {
        a.set("model", [ "a", "b", "c" ]);
    }
}), App.Subject = DS.Model.extend({
    name: DS.attr("string"),
    age: DS.attr("int")
}), App.MongoSample = Ember.Object.extend(), App.MongoSample.reopenClass({
    all: function() {
        return $.getJSON("http://localhost:8082/api/subjects").then(function(a) {
            var b = [];
            return a.forEach(function(a) {
                b.push(App.MongoSample.create(a));
            }), b;
        });
    },
    one: function() {
        return App.MongoSample.create({
            name: "no-name",
            age: 0
        });
    },
    save: function(a) {
        console.log("calling save method..."), $.post("http://localhost:8082/api/subjects/createsubject", {
            Name: a.name,
            Age: a.age
        }, function(a) {
            alert("Data Loaded: " + a);
        });
    }
}), App.ReadRoute = Ember.Route.extend({
    model: function() {
        return App.MongoSample.all();
    }
}), App.InsertRoute = Ember.Route.extend({
    model: function() {
        return App.MongoSample.one();
    },
    setupController: function(a, b) {
        a.set("model", b);
    }
}), App.InsertController = Ember.ObjectController.extend({
    actions: {
        insert_user: function() {
            App.MongoSample.save(this.get("model"));
        }
    }
}), App.SubjectController = Ember.ObjectController.extend({
    actions: {
        removeSubject: function() {
            console.log("calling deleteSubject method...");
            var a = this.get("model");
            $.ajax({
                url: "http://localhost:8082/api/subjects/" + a.id,
                type: "DELETE",
                contentType: "text/plain",
                success: function(b) {
                    $("#" + a.id).remove(), alert("Result: " + b);
                }
            });
        }
    }
}), App.ApplicationAdapter = DS.RESTAdapter.extend({
    host: "http://localhost:8082/api"
}), App.Store = DS.Store.extend({});